import React from 'react';
import MiniDrawer from './Components/MiniDrawer';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LiveComponent from './components/LiveComponent.js';
import  LayoutComponent from './components/LayoutComponent';
import SequenceComponent from './components/SequenceComponent';
import MoreComponent from './components/MoreComponent';
import HelloMessage from './components/HelloMessage';



const App = () => {
  return (
    <Router>
      <MiniDrawer/>
    <Routes>
      <Route path="/" element={<HelloMessage />} />
      <Route path="/live" element={<LiveComponent />} />
      <Route path="/layout" element={<LayoutComponent />} />
      <Route path="/sequence" element={<SequenceComponent />} />
      <Route path="/more" element={<MoreComponent />} />
    </Routes>
  </Router>
  );
};

export default App;
